import React from "react"
import {
    Routes,
    Route
} from "react-router-dom";
import home from "../views/Example/home";
import Listuser from '../views/Users/Listuser';
import Detailuser from './views/Users/detailuser';
import MyCompponent from './views/Example/MyComponent';
import ListTodo from './views/todos/listTodo';
import Colorpick from './views/colorPick/colorPick';

class Router extends React.Component {
    render() {
        return (
            <>
                <div>
                    <Routes>
                        <Route path="colorpick" element={<Colorpick />} />
                        <Route path="/" element={<Home />} />
                        <Route path="/todo" element={<ListTodo />} />
                        <Route path="/about" element={<MyCompponent />} />
                        <Route path="/user" element={<Listuser />} />
                        <Route path="/user/:id" element={<Detailuser />} />
                    </Routes>
                </div>
            </>
        )
    }
}
export default Router
